class MyLabel(QtWidgets.QLabel):
    signal_order = pyqtSignal(int)

    def __init__(self, order=None):
        super(MyLabel, self).__init__()
        self.order = order

    def mousePressEvent(self, e):  # 重载鼠标点击事件
        self.signal_order.emit(self.order)
